import React from "react";
import "./styles.css";

const Contact = () => {
  return (
    <div className="page-container">
      <h2>Contact Us</h2>
      <p>Email: support@alzheimersdetection.com</p>
      <p>Phone: +123 456 7890</p>
    </div>
  );
};

export default Contact;
